import React, { useState } from "react";
import { addLoan } from "../actions/loanActions";
import { useNavigate } from "react-router-dom";
import { NumericFormat } from "react-number-format";

const LoanApplication = () => {
  const [Errors, setErrors] = useState("");
  const [modal, setModal] = useState(false);
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [loanAmount, setLoanAmount] = useState("");
  const [loanTerm, setLoanTerm] = useState("");
  const navigate = useNavigate();

  const toggle = () => {
    setModal(!modal);
  };

  const goback = () => {
    navigate("/dashboard");
  };

  const _Submit = (e) => {
    e.preventDefault();

    const newLoan = {
      name: name,
      email: email,
      loan_amount: loanAmount,
      loan_term: loanTerm,
    };

    // Add loan via addLoan action
    addLoan(newLoan);

    // Open Modal
    //toggle();
  };

  return (
    <form>
      <div className="form-group form-mod has-feedback form-field form-floating mb-2">
        <input
          autoComplete="off"
          className={
            "form-control default-input " +
            (Errors["IsEmpty_name"] === true ? " has-err" : "")
          }
          type="text"
          id="name"
          maxLength="128"
          name="name"
          placeholder="Enter Name"
          defaultValue={name}
          data-fv-field="name"
          tabIndex="1"
          onChange={(e) => setName(e.target.value)}
        />
        {Errors["IsEmpty_name"] === true ? (
          <div className="has-err-msg">{Errors["nameEmptyMsg"]}</div>
        ) : (
          ""
        )}
        <label className="default-label" htmlFor="name">
          Name
        </label>
      </div>
      <div className="form-group form-mod has-feedback form-field form-floating mb-2">
        <input
          autoComplete="off"
          className={
            "form-control default-input " +
            (Errors["IsEmpty_email"] === true ? " has-err" : "")
          }
          type="text"
          id="email"
          maxLength="128"
          name="email"
          placeholder="Enter Email Address"
          defaultValue={email}
          data-fv-field="email"
          tabIndex="1"
          onChange={(e) => setEmail(e.target.value)}
        />
        {Errors["IsEmpty_email"] === true ? (
          <div className="has-err-msg">{Errors["emailEmptyMsg"]}</div>
        ) : (
          ""
        )}
        <label className="default-label" htmlFor="email">
          Email
        </label>
      </div>
      <div className="form-group form-mod form-floating mb-2 form-field" style={{ marginTop: "24px" }}>
        <NumericFormat thousandSeparator={true} inputMode="numeric" autoComplete="off" tabIndex="3" className={"form-control default-input" + (Errors["IsEmpty_loan_amount"] === true ? " has-err" : "")} type="text" id="loan_amount" placeholder="Enter the Loan Amount" require="" prefix={"$"} name="loan_amount" defaultValue={loanAmount} onChange={(e) => setLoanAmount(e.target.value)} />
        {Errors['IsEmpty_loan_amount'] === true ? <div className="has-err-msg">{Errors['loan_amountEmptyMsg']}</div> : ''}
      </div>
      <div className="form-mod has-feedback form-floating mb-2 mt-2 form-field">
        <select className={"form-control form-select " + (Errors["IsEmpty_loanterm"] === true ? " has-err" : "")} aria-label="Floating label" name="loanterm" id="loanterm" tabIndex="4" value={loanTerm} onChange={(e) => setLoanTerm(e.target.value)}>
          <option value="">Select One</option>
          <option value="1">1 Month</option>
          <option value="2">2 Month</option>
          <option value="3">3 Month</option>
          <option value="4">4 Month</option>
          <option value="5">5 Month</option>
          <option value="6">6 Month</option>
        </select>
        {Errors["IsEmpty_loanterm"] === true ? <div className="has-err-msg">{Errors["loantermEmptyMsg"]}</div> : ""}
        <label htmlFor="loanterm">Business Type</label>
      </div>
      <div className="buttons button_space  mt-3">
        <button type="button" className="back_button px-3" onClick={goback}>
          Go Back
        </button>
        <button type="button" className="next_button" onClick={_Submit}>
          Submit
        </button>
      </div>
    </form>
  );
};

export default LoanApplication;
